import React from 'react';
import { NavLink} from "react-router-dom";
import { IoMdSearch } from "react-icons/io";
import '../App.css';
import * as Constants from '../constants';


class NavBar extends React.Component {

    constructor(props) {
		super(props);
		this.state = {
            searchFor: ''
		};
    }

    womanPaths = () => {
        return Constants.women.slice(1).map((category) => <li key = {category.value}><NavLink to={'/listings/women/' + category.value}>{category.label}</NavLink></li>);   
    }
    manPaths = () => {
        return Constants.men.slice(1).map((category) => <li key = {category.value}><NavLink to={'/listings/men/' + category.value}>{category.label}</NavLink></li>);   
    }
    kidPaths = () => {
        return Constants.kids.slice(1).map((category) => <li key = {category.value}><NavLink to={'/listings/kids/' + category.value}>{category.label}</NavLink></li>);   
    }

    onSearchChange = (e) => {
        this.setState({searchFor: e.target.value})
    }

    onSearchClick = () => {
        const path = window.location.href;
        if(path.includes('searchresults')) {
            this.props.callBackParent(this.state.searchFor);
        }
        else {
            const value = this.state.searchFor;
            window.location.href = `/searchresults?${value}`;
        }
    }

    handleKeyDown = (event) => {
        if (event.key === 'Enter') {
           this.onSearchClick();
        }
    }

    render() {

        const searchBtnStyle = {
            color: 'black',
            height: '100%',
            minWidth: '50px',
            backgroundColor: 'rgb(255, 255, 255, 0)',
            borderRadius: '0',
            margin: '0px',
            padding: '0px',
            verticalAlign: 'middle',
            border: 'none',
            cursor: 'pointer'
        }

        const searchStyle = {
            width: '100px',
            height: '100%',
            border: 'none',
            backgroundColor: 'rgb(255, 255, 255, 0)',
            borderRadius: '0',
            margin: '0px',
            display: 'inline-block'
        }

        return(

        <nav>
            <menu>
                <menuitem id="demo1">
                    <a>drop</a>
                    <menu>
                        <menuitem><a>about</a></menuitem>
                <menuitem>
                    <a>settings</a>
                    <menu>
                        <menuitem><a>Test 1</a></menuitem>
                        <menuitem><a>Test 2</a></menuitem>
                        <menuitem><a>Test 3</a></menuitem>
                        <menuitem><a>Test 4</a></menuitem>
                    </menu>  
                </menuitem>
                        <menuitem><a>help</a></menuitem>
                        <menuitem id="demo2">
                            <a>more</a>
                            <menu>
                                <menuitem id="demo3">
                                    <a>deeper</a>
                                    <menu>
                                        <menuitem><a>deep 1</a></menuitem>
                                        <menuitem><a>deep 2</a></menuitem>
                                        <menuitem><a>deep 3</a></menuitem>
                                    </menu>
                                </menuitem>
                                <menuitem><a>test</a></menuitem>
                            </menu>
                        </menuitem>
                    </menu>
                </menuitem>
            <menuitem><a>no drop</a></menuitem>
            </menu>
	</nav>

        )

    }
}

export default NavBar
